              <section id="ip-blocklist">
                <h2>Botnet C2 IP Blocklist</h2>
                <hr>
                <p>Dridex, Heodo (aka Emotet) and TrickBot botnet command&amp;control servers (C&amp;Cs) reside on compromised servers and servers that have been rent and setup by the botnet herder itself for the sole purpose of botnet hosting. Feodo Tracker offers a blocklist of IP addresses that are associated with such botnet C&amp;Cs that can be used to detect and block botnet C2 traffic from infected machines towards the internet. <strong>An IP address will only get added to the blocklist if it responds with a valid botnet C2 response</strong>. However, a botnet C2 may become offline later. The Botnet C2 IP Blocklist is available in different formats documented below.</p>
                <p>The Botnet C2 IP Blocklist gets generated every 5 minutes. Please do not fetch it more often than every 5 minutes.</p>
                <p>The CSV is useful if you want to process the IP blocklist further, e.g. loading them into your SIEM. The CSV contains the following values:</p>
                <ul>
                  <li>Firstseen</li>
                  <li>Destination IP (DstIP)</li>
                  <li>Destination Port (DstPort)</li>
                  <li>Last online (date)</li>
                  <li>Malware family</li>
                </ul>
                <p><a class="btn btn-primary" href="/downloads/ipblocklist.csv" title="download Botnet C2 IP Blacklist (CSV)" target="_parent" role="button">Download CSV</a></p>
                <div class="alert alert-info" role="alert">
                  <h4 class="alert-heading">Note</h4>
                  <p>As IP addresses are getting recycled and reused, the CSV only botnet C2s that are either active or that have been last seen in the <strong>past 30 days</strong>. The false positive rate for this blocklist should therefore be low.</p>
                </div>
                <div class="alert alert-success" role="alert">
                  <h4 class="alert-heading">Recommended IP blocklist</h4>
                  If you want to block botnet C&amp;C IP addresses but avoid false positives, I highly recommend you to use the following blocklist as it only contains <strong>active</strong> botnet C&amp;C servers or such that have been active in the past hours. Although false positives can happen on this blocklist, the false positive rate should be low.</p>
                  <p><a class="btn btn-primary" href="/downloads/ipblocklist_recommended.txt" title="download Botnet C2 IP Blacklist (recommended)" target="_parent" role="button">Download recommended IP blocklist</a></p>
                </div>
                <p>In addition to the CSV and the recommended IP blocklist above, there is an <em>IPs only</em> list available for download below. This is handy if you want to use botnet C&amp;Cs tracked by Feodo Tracker as a list of <strong>Indicator Of Compromise (IOC)</strong>.</p>
                <p><a class="btn btn-primary" href="/downloads/ipblocklist.txt" title="download Botnet C2 IP Blacklist (IPs only)" target="_parent" role="button">Download IPs only</a></p>
                <p>If you want to fetch a comprehensive list of all botnet C2s Feodo Tracker has ever seen (and no matter if they have ever been seen being active/online or not), please use the CSV provided below.</p>
                <div class="alert alert-warning" role="alert">
                  <h4 class="alert-heading">Caution!</h4>
                  <p>I strongly recommend you to <strong>not use the aggressive version</strong> of the Botnet C2 IP blocklist as it definitely <strong>will cause false positives</strong>. If you want to reduce the amount of false positives, use the blacklist above this box. If you want to get maximum protection and don't care about false positives, use the blacklist below this box (not recommended).</p>
                </div>
                <p><a class="btn btn-primary" href="/downloads/ipblocklist_aggressive.csv" title="download Botnet C2 IP Blacklist (CSV) - Aggressive" target="_parent" role="button">Download CSV (Aggressive)</a></p>
                <p>In addition, there is an <em>IPs only</em> list available for download below. This is handy if you want to use botnet C&amp;Cs tracked by Feodo Tracker as a list of Indicator Of Compromise (IOC).</p>
                <p><a class="btn btn-primary" href="/downloads/ipblocklist_aggressive.txt" title="download Botnet C2 IP Blacklist (CSV)" target="_parent" role="button">Download IPs only (Aggressive)</a></p>
              </section>
              <section id="ip-ids">
                <h2>Suricata Botnet C2 IP Ruleset</h2>
                <hr>
                <p>The Suricata Botnet C2 IP Ruleset contains Dridex and Emotet/Heodo botnet command&amp;control servers (C&amp;Cs) tracked by Feodo Tracker and can be used for both, <a href="http://suricata-ids.org/" target="_blank" title="Suricata IDS/IPS">Suricata</a> and <a href="https://www.snort.org/" target="_blank" title="Snort IDS/IPS">Snort</a> open source IDS/IPS. If you are running Suricata or Snort, you can use this ruleset to detect and/or block network connections towards hostline servers (IP address:port combination).</p>
                <p>The Suricata Botnet C2 IP Ruleset gets generated every 5 minutes. Please do not fetch it more often than every 5 minutes.</p>
                <div class="alert alert-info" role="alert">
